The Rocco Siffredi production team returns to St. Petersburg, Russia for the third installment of his Puppet Master series, where Rocco's big-dicked crew of sexual thugs take on a new array of amazingly hot bitches. Rocco the director manipulates these gorgeous Eastern European ladies in four explicitly anal vignettes that showcase the dark, perverse imagination that built his world reputation as a performer.
Fans of uninhibited, nasty fucking. It's out of control! The disc contains 31 minutes of behind-the-scenes footage plus five photo galleries and nine Rocco trailers.

Stella Delcroix, Blue Angel, Lolly Blond, Giuliana Grandi, Candy Alexa, Nastya Pamela, Katerina Cox, Miss Love

